package Labs.LabExercise_10;public class Employee {    private int employeeId;    private String name;    private Labs.LabExercise_10.Date dateOfJoining;    public Employee(int employeeId, String name, Labs.LabExercise_10.Date dateOfJoining) {        this.employeeId = employeeId;        this.name = name;        this.dateOfJoining = dateOfJoining;    }    public int getEmployeeId() {        return employeeId;    }    public void setEmployeeId(int employeeId) {        this.employeeId = employeeId;    }    public String getName() {        return name;    }    public Labs.LabExercise_10.Date getDateOfJoining() {        return dateOfJoining;    }    public void setDateOfJoining(Labs.LabExercise_10.Date dateOfJoining) {        this.dateOfJoining = dateOfJoining;    }    public void displayDetails() {        System.out.println("Employee ID-" + employeeId+"Name: " + name+ "joining date- "+ dateOfJoining);    }}